import React from 'react';
import OutputScreenRow from './outputScreenRow.js';
import '../index.css'

const OutputScreen = (props) => {
  return (
    <div className='row'>
      <div className='col-1'>
      <OutputScreenRow label= 'Input' className="screen" value = {props.question}/>
      <OutputScreenRow label = 'Answer' className="screen" value = {props.answer}/>
    </div>
    </div>
  )
}

export default OutputScreen;
